-- ----------------------------
DROP TABLE IF EXISTS `cmswing_discount`;
CREATE TABLE `cmswing_discount` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `desc` varchar(255) DEFAULT NULL COMMENT '简介',
  `start_time` bigint(20) DEFAULT NULL COMMENT '开始时间',
  `end_time` bigint(20) DEFAULT NULL COMMENT '结束时间',
  `status` varchar(255) DEFAULT NULL COMMENT '状态0正常1过期',
  `type_id` varchar(255) DEFAULT NULL COMMENT '类型0打折券1减免券',
  `percent` double DEFAULT NULL COMMENT '百分比',
