  `max_count` bigint(11) DEFAULT '9999999' COMMENT '最大发行数量',
  `pull_count` int(11) DEFAULT '0' COMMENT '领取数量',
  `use_count` int(11) DEFAULT '0' COMMENT '使用数量',
  `is_show` varchar(255) DEFAULT '0' COMMENT '0使用1不适用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

