-- ----------------------------
--  Table structure for `cmswing_order_log`
-- ----------------------------
DROP TABLE IF EXISTS `cmswing_order_log`;
CREATE TABLE `cmswing_order_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT NULL,
  `user` varchar(20) CHARACTER SET utf8 DEFAULT NULL,
  `action` varchar(20) CHARACTER SET utf8 DEFAULT NULL,
  `addtime` datetime DEFAULT NULL,
  `result` varchar(10) CHARACTER SET utf8 DEFAULT NULL,
  `note` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

-- ----------------------------
--  Table structure for `cmswing_region`
-- ----------------------------
DROP TABLE IF EXISTS `cmswing_region`;
CREATE TABLE `cmswing_region` (
  `city_id` bigint(20) DEFAULT NULL COMMENT '城市ID',
  `city_name` varchar(255) DEFAULT NULL COMMENT '城市名称',
  `area_id` int(11) DEFAULT NULL COMMENT '地区ID',
  `area_name` varchar(255) DEFAULT NULL COMMENT '地区名称',
  `town_id` int(11) DEFAULT NULL COMMENT '镇ID',
  `town_name` varchar(255) DEFAULT NULL COMMENT '镇名称',
  `street_id` int(11) DEFAULT NULL COMMENT '街道楼ID',
  `street_name` varchar(255) DEFAULT NULL COMMENT '街道楼名称'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
--  Table structure for `cmswing_restaurant`
-- ----------------------------
DROP TABLE IF EXISTS `cmswing_restaurant`;
CREATE TABLE `cmswing_restaurant` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `discount_id` varchar(20) DEFAULT NULL COMMENT '菜品ID',
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `contect_tel` varchar(255) DEFAULT NULL COMMENT '联系电话',
  `range` varchar(255) DEFAULT NULL COMMENT '经营范围',
  `fee_standard` varchar(255) DEFAULT NULL COMMENT '标准消费',
  `addr` varchar(255) DEFAULT NULL COMMENT '地址',
  `owner_name` varchar(255) DEFAULT NULL COMMENT '店主姓名',
  `support_paytype` varchar(255) DEFAULT NULL COMMENT '支持支付方式',
  `desc` varchar(255) DEFAULT NULL COMMENT '简介',
  `bg_image` varchar(255) DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  `score` varchar(255) DEFAULT '0' COMMENT '评分',
  `sales` varchar(255) DEFAULT '0' COMMENT '销量',
  `send_money` varchar(255) DEFAULT NULL COMMENT '配送费',
  `send_time` varchar(255) DEFAULT NULL COMMENT '配送时间',
  `min_price` double DEFAULT NULL,
  `is_close` varchar(255) DEFAULT '0',
  `sort` int(11) DEFAULT '999',
  `nature_id` int(11) DEFAULT '1' COMMENT '性质ID，cmswing_nature',
  `is_send` varchar(255) DEFAULT '1' COMMENT '0:配送1不配送',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

